import React from "react";
import { Card } from "react-bootstrap";

const Favourites =(props)=>{
    return(
        <>
            {
                props.item.map(i=>(
                    <div className="favouriteCard">
                        <Card style={{ width: '90%', marginLeft:"20px", marginTop:"20px", padding:"20px", alignItems:"center" }}>
                    <Card.Img variant="top" style={{width:'40%'}} src={i.strMealThumb} />
                    <Card.Body>
                        <Card.Title style={{textAlign:"center"}}>{i.strMeal}</Card.Title>
                        <Card.Text>
                        {i.strInstructions}
                        </Card.Text>
                    </Card.Body>
                    </Card>
                    </div>
                ))
            }
        </>
    )
}

export default Favourites;
